"use client";
import * as r from "react";
class n extends r.Component {
  shouldComponentUpdate(e) {
    return e.shouldUpdateOnDrag || !e.isDragging;
  }
  render() {
    return this.props.children;
  }
}
export {
  n as MiddleLayerOptimization
};
